                type="button"
                fullWidth
                variant="contained"
                sx={{ mt: 3, mb: 2 }}
                onClick={activateAlgorithm}
              >
                הפעלת האלגוריתם
              </Button>
            </>} */}
        </Box>

      </Container>
    </ThemeProvider>
  );
}
